// 该文件是整个项目的入口文件

// 引入Vue
import Vue from 'vue'
// 引入App组件，它是所有组件的父组件
import App from './App.vue'
// 关闭vue的生产提示
Vue.config.productionTip = false

// 创建Vue实例对象---vm
new Vue({
  el:'#app',
  render: h => h(App), //将App组件放入容器中
  // 配置残缺vue时，可以利用 render 来渲染,render 是个函数，vue帮忙调

  // 可有参数可无参数
  // 简写：  render:createElement=> createElement('h1','你好啊')
  // render(createElement) {
  // render:createElement=>{
  //   console.log(createElement);
  //   // 必须有返回值
  //   return createElement('h1','你好啊')
  // },
  template:`
    <h1>你好啊</h1>
  `
})
